import React from "react";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import FormPage from "./components/FormPage";
import "./App.css";


toast.configure();


function App() {
  return (
    <div className="App">
      <FormPage />
    </div>
  );
}

export default App;
